import React from 'react';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";
import './App.css';
import Navbar from './components/Navbar.js'


function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />

      </div>
        <Routes>
          <Route path="/warmups" component={ <Warmups/> } />
          <Route path="/react" component={ <ReactPage /> } />
          <Route path="/" component={ <Home/> } />
        </Routes>

    </Router>

  );
}

function Home() {
  return <h2>Home</h2>;
}

function About() {
  return <h2>About</h2>;
}

function Cheatsheet() {
  return <h2>Cheatsheet</h2>;
}

export default App;
